    "west-coast-observing-system-wcos-temperature-data",nt"isopen": false,nt"url":
    null,nt"notes": "The West Coast Observing System (WCOS) project provides access
    to temperature and currents data collected at four of the five National Marine Sanctuary
    sites, including Olympic Coast, Gulf of the Farallones, Monterey Bay, and Channel
    Islands. A semi-automated end-to-end data management system transports and transforms
    the data from source to archive, making the data acessible for discovery, access
    and analysis from multiple Internet points of entry.nnThe stations (and their code
    names) are Ano Nuevo (ANO001), San Miguel North (BAY), Santa Rosa North (BEA), Big
    Creek (BIG001), Bodega Head (BOD001), Cape Alava 15M (CA015), Cape Alava 42M (CA042),
    Cape Alava 65M (CA065), Cape Alava 100M (CA100), Cannery Row (CAN001), Cape Elizabeth
    15M (CE015), Cape Elizabeth 42M (CE042), Cape Elizabeth 65M (CE065), Cape Elizabeth
    100M (CE100), Cuyler Harbor (CUY), Esalen (ESA001), Point Joe (JOE001), Kalaloch
    15M (KL015), Kalaloch 27M (KL027), La Cruz Rock (LAC001), Lopez Rock (LOP001), Makah
    Bay 15M (MB015), Makah Bay 42M (MB042), Pelican/Prisoners Area (PEL), Pigeon Point
    (PIG001), Plaskett Rock (PLA001), Southeast Farallon Island (SEF001), San Miguel
    South (SMS), Santa Rosa South (SRS), Sunset Point (SUN001), Teawhit Head 15M (TH015),
    Teawhit Head 31M (TH031), Teawhit Head 42M (TH042), Terrace Point 7 (TPT007), Terrace
    Point 8 (TPT008), Valley Anch (VAL), Weston Beach (WES001).",nt"license_title":
